module.exports = /*#__PURE__*/JSON.parse('[{"topic":"inspiration","quote":"The only way to do great work is to love what you do.","writer":"Steve Jobs"},{"topic":"inspiration","quote":"Success is not final, failure is not fatal: it is the courage to continue that counts.","writer":"Winston Churchill"},{"topic":"inspiration","quote":"Believe you can and you\'re halfway there.","writer":"Theodore Roosevelt"},{"topic":"wisdom","quote":"The only true wisdom is in knowing you know nothing.","writer":"Socrates"},{"topic":"wisdom","quote":"The journey of a thousand miles begins with a single step.","writer":"Lao Tzu"},{"topic":"wisdom","quote":"Knowing yourself is the beginning of all wisdom.","writer":"Aristotle"},{"topic":"technology","quote":"Technology is best when it brings people together.","writer":"Matt Mullenweg"},{"topic":"technology","quote":"The advance of technology is based on making it fit in so that you don\'t even notice it.","writer":"Bill Gates"},{"topic":"technology","quote":"Any sufficiently advanced technology is indistinguishable from magic.","writer":"Arthur C. Clarke"},{"topic":"change","quote":"Be the change that you wish to see in the world.","writer":"Mahatma Gandhi"},{"topic":"change","quote":"The measure of intelligence is the ability to change.","writer":"Albert Einstein"},{"topic":"change","quote":"If you want to fly, you have to give up the things that weigh you down.","writer":"Toni Morrison"},{"topic":"creativity","quote":"Creativity is intelligence having fun.","writer":"Albert Einstein"},{"topic":"creativity","quote":"You can\'t use up creativity. The more you use, the more you have.","writer":"Maya Angelou"},{"topic":"creativity","quote":"Imagination is the beginning of creation.","writer":"George Bernard Shaw"},{"topic":"inspiration","quote":"The future belongs to those who believe in the beauty of their dreams.","writer":"Eleanor Roosevelt"},{"topic":"inspiration","quote":"It is never too late to be what you might have been.","writer":"George Eliot"},{"topic":"inspiration","quote":"What you get by achieving your goals is not as important as what you become by achieving your goals.","writer":"Zig Ziglar"},{"topic":"inspiration","quote":"The mind is everything. What you think you become.","writer":"Buddha"},{"topic":"inspiration","quote":"Strive not to be a success, but rather to be of value.","writer":"Albert Einstein"},{"topic":"wisdom","quote":"Count your age by friends, not years. Count your life by smiles, not tears.","writer":"John Lennon"},{"topic":"wisdom","quote":"The greatest glory in living lies not in never falling, but in rising every time we fall.","writer":"Nelson Mandela"},{"topic":"wisdom","quote":"In the end, it\'s not the years in your life that count. It\'s the life in your years.","writer":"Abraham Lincoln"},{"topic":"wisdom","quote":"To live is the rarest thing in the world. Most people exist, that is all.","writer":"Oscar Wilde"},{"topic":"wisdom","quote":"He who has a why to live can bear almost any how.","writer":"Friedrich Nietzsche"},{"topic":"technology","quote":"Innovation distinguishes between a leader and a follower.","writer":"Steve Jobs"},{"topic":"technology","quote":"The Web as I envisaged it, we have not seen it yet. The future is still so much bigger than the past.","writer":"Tim Berners-Lee"},{"topic":"technology","quote":"The art of technology is to arrange the world so that we don\'t have to experience it.","writer":"Max Frisch"},{"topic":"technology","quote":"It\'s not a faith in technology. It\'s faith in people.","writer":"Steve Jobs"},{"topic":"technology","quote":"The best way to predict the future is to invent it.","writer":"Alan Kay"},{"topic":"change","quote":"Yesterday I was clever, so I wanted to change the world. Today I am wise, so I am changing myself.","writer":"Rumi"},{"topic":"change","quote":"The world as we have created it is a process of our thinking. It cannot be changed without changing our thinking.","writer":"Albert Einstein"},{"topic":"change","quote":"They always say time changes things, but you actually have to change them yourself.","writer":"Andy Warhol"},{"topic":"change","quote":"Education is the most powerful weapon which you can use to change the world.","writer":"Nelson Mandela"},{"topic":"change","quote":"Change will not come if we wait for some other person or some other time. We are the ones we\'ve been waiting for.","writer":"Barack Obama"},{"topic":"creativity","quote":"Creativity is seeing what others see and thinking what no one else ever thought.","writer":"Albert Einstein"},{"topic":"creativity","quote":"The chief enemy of creativity is good sense.","writer":"Pablo Picasso"},{"topic":"creativity","quote":"Creativity takes courage.","writer":"Henri Matisse"},{"topic":"creativity","quote":"Every child is an artist. The problem is how to remain an artist once he grows up.","writer":"Pablo Picasso"},{"topic":"creativity","quote":"An essential aspect of creativity is not being afraid to fail.","writer":"Edwin Land"},{"topic":"life","quote":"Life is what happens when you\'re busy making other plans.","writer":"John Lennon"},{"topic":"life","quote":"Get busy living or get busy dying.","writer":"Stephen King"},{"topic":"life","quote":"You only live once, but if you do it right, once is enough.","writer":"Mae West"},{"topic":"life","quote":"The purpose of our lives is to be happy.","writer":"Dalai Lama"},{"topic":"life","quote":"Life is really simple, but we insist on making it complicated.","writer":"Confucius"},{"topic":"success","quote":"Success is walking from failure to failure with no loss of enthusiasm.","writer":"Winston Churchill"},{"topic":"success","quote":"The road to success and the road to failure are almost exactly the same.","writer":"Colin R. Davis"},{"topic":"success","quote":"I have not failed. I\'ve just found 10,000 ways that won\'t work.","writer":"Thomas A. Edison"},{"topic":"success","quote":"There are no secrets to success. It is the result of preparation, hard work, and learning from failure.","writer":"Colin Powell"},{"topic":"success","quote":"The only limit to our realization of tomorrow will be our doubts of today.","writer":"Franklin D. Roosevelt"},{"topic":"knowledge","quote":"An investment in knowledge pays the best interest.","writer":"Benjamin Franklin"},{"topic":"knowledge","quote":"The only source of knowledge is experience.","writer":"Albert Einstein"},{"topic":"knowledge","quote":"To know what you know and what you do not know, that is true knowledge.","writer":"Confucius"},{"topic":"knowledge","quote":"Real knowledge is to know the extent of one\'s ignorance.","writer":"Confucius"},{"topic":"knowledge","quote":"The good life is one inspired by love and guided by knowledge.","writer":"Bertrand Russell"},{"topic":"art","quote":"The principles of true art is not to portray, but to evoke.","writer":"Jerzy Kosinski"},{"topic":"art","quote":"Art is not what you see, but what you make others see.","writer":"Edgar Degas"},{"topic":"art","quote":"Every artist dips his brush in his own soul, and paints his own nature into his pictures.","writer":"Henry Ward Beecher"},{"topic":"art","quote":"Art enables us to find ourselves and lose ourselves at the same time.","writer":"Thomas Merton"},{"topic":"art","quote":"The essence of all beautiful art, all great art, is gratitude.","writer":"Friedrich Nietzsche"},{"topic":"humor","quote":"I am so clever that sometimes I don\'t understand a single word of what I am saying.","writer":"Oscar Wilde"},{"topic":"humor","quote":"A day without sunshine is like, you know, night.","writer":"Steve Martin"},{"topic":"humor","quote":"I\'m sorry, if you were right, I\'d agree with you.","writer":"Robin Williams"},{"topic":"humor","quote":"Never put off till tomorrow what you can do the day after tomorrow just as well.","writer":"Mark Twain"},{"topic":"humor","quote":"I find television very educational. Every time somebody turns on the set, I go into the other room and read a book.","writer":"Groucho Marx"}]');

